import React, { Fragment } from 'react';
import Navbar from '../components/layout/Navbar';
import Movie from './Movie';

const MovieDetails = ({ movie }) => {
  return (
    <Fragment>
      <Navbar />
      <h3>{movie.Title}</h3>
    </Fragment>
  );
};

export default MovieDetails;
